import Top from "./01_top";
import Informations from "./03_information";
import Archives from "./04_archive";
import PropTypes from "prop-types";
import styles from "./home.module.css";

const Home = ({ className = "" }) => {
  return (
    <main className={[styles.subtract, className].join(" ")}>
      <section className={styles.subtractOneContainer}>
        <img className={styles.subtractIcon} alt="" src="/img_background.jpg" />
        <Top />
        <div className={styles.aboutContainer}>
          <div className={styles.aboutContainerChild} />
          <a className={styles.about}>about</a>
        </div>
        <Informations />
      </section>
      <Archives />
    </main>
  );
};

Home.propTypes = {
  className: PropTypes.string,
};

export default Home;
